import React, { Component } from 'react'
import "./App.css"

export default class App extends Component {
  constructor(){
    super();
    this.state = {
      monsters:[
        {
          name: "Dracula",
          id: "ss1"
        },
        {
          name: "Zombie",
          id: "ss2"
        },
        {
          name: "Terminator",
          id: "ss3"
        },
        {
          name: "Frankenstein",
          id: "ss4"
        }
      ]
    }
  }
  componentDidMount
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map( monster => (
            <h1 key={monster.id}>{monster.name}</h1>
          ))
        }
      </div>
    )
  }
}
